import { actionType } from "../constants/actionTypes";
initialState={
    users:[{
        id:1,
        name:'raju',
        email:'raju@gmail.com'
    }]
}

export const usersReducer = (state =initialState,{type,payload})=>{
    switch(type){
        case actionType.GET_USERS:
        return  {...state,users:payload}
    }

}
